import {useRef} from "react"

const profile_overlay = ({set_profile_vis, profile_vis, profile_ref}) => {
  const profile = useRef();
  return (
    <div id="profile-overlay" style={{visibility: profile_vis}} ref={profile}>
      <div id="profile-header">
        <div id="profile-picture"></div>
        <div id="profile-name">Name</div>
      </div>
    </div>
  );
};

export default profile_overlay;
